import React from 'react';
import styled from 'styled-components';
import { ModalGateway, Modal } from 'react-images';

// Im치genes de los proyectos
import HotelImage from './images/hotel.jpg';
import TodoListImage from './images/todo-list.jpg';
import NominaImage from './images/nomina.jpg';

const ProjectsSection = styled.section`
  padding: 80px 20px;
  background: linear-gradient(135deg, #262626 0%, #1a1a1a 100%);
  color: #fff;
`;

const Title = styled.h2`
  font-family: 'Orbitron', sans-serif;
  font-size: 3rem;
  color: #00ffcc;
  text-align: center;
  margin-bottom: 50px;
`;

const ProjectsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 30px;
  justify-items: center;
`;

const ProjectCard = styled.div`
  background: #2a2a2a;
  padding: 20px;
  border-radius: 10px;
  transition: transform 0.3s, box-shadow 0.3s;
  cursor: pointer;
  box-shadow: 0px 8px 15px rgba(0, 0, 0, 0.1);

  &:hover {
    transform: scale(1.03);
    box-shadow: 0px 12px 20px rgba(0, 0, 0, 0.2);
  }
`;

const ProjectTitle = styled.h3`
  font-family: 'Roboto', sans-serif;
  font-size: 1.8rem;
  color: #00ffcc;
  margin-bottom: 15px;
`;

const ProjectDescription = styled.p`
  font-family: 'Roboto', sans-serif;
  font-size: 1.1rem;
  color: #ccc;
  line-height: 1.4;
`;

const ImageContainer = styled.div`
  margin-bottom: 15px;
  img {
    width: 100%;
    border-radius: 10px;
  }
`;

const Link = styled.a`
  color: #00ffcc;
  text-decoration: none;
  &:hover {
    text-decoration: underline;
  }
`;

const Projects = () => {
  // Im치genes de los proyectos
  const images = [
    {
      src: HotelImage,
      alt: 'Hotel Golden Dream',
    },
    {
      src: TodoListImage,
      alt: 'To Do List App',
    },
    {
      src: NominaImage,
      alt: 'Gestor de N칩minas',
    },
  ];

  return (
    <ProjectsSection id="projects">
      <Title>My Projects</Title>
      <ProjectsGrid>
        <ProjectCard>
          <ImageContainer>
            <img src={HotelImage} alt="Hotel Golden Dream" />
          </ImageContainer>
          <ProjectTitle>Hotel Golden Dream</ProjectTitle>
          <ProjectDescription>
            Desarrollo de una p치gina web completa para un hotel utilizando PHP como lenguaje principal. Proporciona una experiencia de usuario 칩ptima, permitiendo a los visitantes obtener informaci칩n detallada, explorar habitaciones disponibles, realizar reservas en l칤nea y contactar con el hotel. Dise침ado para ser intuitivo, visualmente atractivo y funcional. Detalles en <Link href="https://github.com/chicho377/Hotel-Golden-Dream" target="_blank">GitHub</Link>.
          </ProjectDescription>
        </ProjectCard>
        <ProjectCard>
          <ImageContainer>
            <img src={TodoListImage} alt="To Do List App" />
          </ImageContainer>
          <ProjectTitle>To Do List App</ProjectTitle>
          <ProjectDescription>
            Aplicaci칩n web para gestionar tareas diarias, a침adir subtareas, editar y eliminar tareas existentes. Interfaz de usuario intuitiva y en desarrollo activo. Detalles en <Link href="https://github.com/chicho377/to-do-list-app" target="_blank">GitHub</Link>.
          </ProjectDescription>
        </ProjectCard>
        <ProjectCard>
          <ImageContainer>
            <img src={NominaImage} alt="Gestor de N칩minas" />
          </ImageContainer>
          <ProjectTitle>Gestor de N칩minas</ProjectTitle>
          <ProjectDescription>
            Programa en C++ para calcular salarios netos, ideal para empresas que gestionan n칩minas de empleados. Interfaz de usuario intuitiva y en desarrollo activo. Detalles en <Link href="https://github.com/chicho377/Gestion-de-Nomina-de-Empleados" target="_blank">GitHub</Link>.
          </ProjectDescription>
        </ProjectCard>
      </ProjectsGrid>
      <ModalGateway>
        <Modal>
          <img src="" alt="" />
        </Modal>
      </ModalGateway>
    </ProjectsSection>
  );
};

export default Projects;
